        string:
          '{"description":"<div>A monthly book discussion group for the queer
          community.<\/div><div style=\"margin-top: 20px\"><div style=\"margin: 20px
          10px;font-size: 15px;line-height: 22px;font-weight: 400;text-align: left;\"><h3>
          Event Details<\/h3><p><br><\/p><ul><li><strong><strong>Date:<\/strong><\/strong>
          June 4th, 2025<\/li><li><strong><strong>Time:<\/strong><\/strong> 7:00 PM<\/li><li><strong><strong>Location:<\/strong><\/strong>
          Queer Lit, Manchester<\/li><li> RSVP Now<\/li><\/ul><p><br><\/p><h3>Book Synopsis:
          <em><em>Traumaland<\/em><\/em> by Josh Silver<\/h3><p>Seventeen-year-old Eli
          is emotionally numb after a near-fatal car crash. With no memory of the months
          following the accident, he struggles to feel anything at all. In search of
          sensation, Eli discovers Traumaland, an underground club where patrons enter
          virtual reality simulations of nightmarish scenarios. Each simulation offers
          a chance to experience life through someone else''s trauma. When Eli enters
          the story of Jack, a boy trapped in a harrowing simulation, he uncovers a
          chilling truth about the club. This revelation sets him on a dangerous journey
          to confront his own buried trauma. <em><em>Traumaland<\/em><\/em> is a gripping
          psychological thriller that explores the depths of human emotion and the lengths
          one will go to feel alive again.<\/p><p><br><\/p><h3>About the Author: Josh
          Silver<\/h3><p>Josh Silver is a British author born in 1989. He grew up on
          a farm in the Lake District and later moved to Manchester. Silver attended
          RADA at 18 and pursued a career in acting, performing in productions such
          as the Royal Shakespeare Company''s <em><em>Wolf Hall<\/em><\/em> and <em><em>Bring
          Up the Bodies<\/em><\/em>, and alongside Nicole Kidman in <em><em>Photograph
          51<\/em><\/em> in the West End. After retraining as a mental health nurse,
          he began writing young adult fiction. His debut novel, <em><em>HappyHead<\/em><\/em>,
          was shortlisted for the 2024 YA Book Prize and nominated for the 2024 Carnegie
          Medal. The sequel, <em><em>Dead Happy<\/em><\/em>, was published in May 2024.
          His third YA book, <em><em>Traumaland<\/em><\/em>, a standalone psychological
          thriller, was published on 8 May 2025 .<\/p><p><br><\/p><h3>Special Guest:
          Josh Silver<\/h3><p>We are thrilled to announce that Josh Silver will be joining
          us for this month''s book club meeting! This is a rare opportunity to engage
          directly with the author of <em><em>Traumaland<\/em><\/em>. Josh will discuss
          the inspiration behind the novel, delve into its themes, and answer your questions.
          Don''t miss this chance to gain deeper insights into the book from the author
          himself.<\/p><p><br><\/p><p>Secure your spot for this exciting event by RSVPing
          on our <a href=\"#\" title=\"#\" target=\"_blank\" data-msys-clicktrack=\"0\"
          rel=\"nofollow noopener noreferrer\">Eventbrite page<\/a>. Spaces are limited,
          so be sure to reserve your place early.<\/p><p><br><\/p><p><strong><strong>Join
          us for an evening of compelling discussion, deep dives into contemporary queer
          literature, and a chance to connect with fellow readers. We look forward to
          seeing you there!<\/strong><\/strong><\/p><\/div><\/div>"}'
